import React, {Component} from 'react';
import {Helmet} from "react-helmet";

const title = "Skills|Alper Tunca";

class Skills extends Component {

    render() {
        const textStyle = {
            color: "#34A4EB",
            fontSize: "16px"
        };

        return (
            <div>
                <Helmet>
                    <title>{title}</title>
                </Helmet>

                <h1 style={textStyle}>Skill Pages</h1>


            </div>
        );
    }
}

export default Skills;
